    return (
        <div style={{margin: 0, padding: 0}}>
            <img src="src/loginfond.jpg" style={{ width: window.innerWidth, height: window.innerHeight, margin: 0, padding: 0, position: 'absolute'}} alt="fondlogin"/>
        </div>
    )
}

